        getTodos()
        .then(res => setTodos(res.json()))
    }, [])
    console.log(todos)



    return (
      <div className="App">
        <h1>ToDo List</h1>
      <ul>
        {todos.map((todos,index) =>{
          return (
            <li className="td" key={index}> {todos}

            </li>
          )
        })}
      </ul>
      </div>
    );
  }
